import React from 'react';
import styled from 'styled-components';

import { NavLink } from 'react-router-dom';
import {Div, Input, Button} from '../styles/DefaultStyles';



const DivCreatingPlan = styled(Div)`
  grid-area: add;
  height:100%;

  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  align-items: center;
`;


const DivHeader = styled(Div)`
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: center;
`

const DivTitle = styled(Div)`
  font-size: 1.6rem;
`
const DivId = styled(Div)`
  color: ${props => props.theme.color_weak};
`


const DivInput = styled(Div)`
	height: 150px;
	display: flex;
  flex-direction: column;
  justify-content: space-evely;
  align-items: center;
`

const InputPw = styled(Input)`
  width: 25%;  // 400*0.25 = 100
  max-width: 150px; // entire 400 ~ 600 



  &::placeholder {
    color: ${props => props.theme.color_weak};
  }
`

const InputBattletag = styled(Input)`
  width: 25%;  // 400*0.25 = 100
  max-width: 150px; // entire 400 ~ 600 



  &::placeholder {
    color: ${props => props.theme.color_weak};
  }
`

const ButtonAddFirst = styled(Button)`

`




 const CreatingPlan = () => {



  return (

  <DivCreatingPlan>

    <DivHeader>
      <DivTitle> Team Generator </DivTitle>

      <DivId> add battletag first to create plan</DivId>
    </DivHeader>


    <Div>

	    <DivInput>
	      <InputPw placeholder="password" />
	      <InputPw placeholder="password again" />
	      <InputBattletag placeholder="battletag#1234" />
	    </DivInput>

	     <ButtonAddFirst> Create Plan </ButtonAddFirst>

    </Div>

  </DivCreatingPlan>

  )

}



export default CreatingPlan;
